import './App.css';
// import Header from './Header';
// import Nav from './Nav';
// import Footer from './Footer';

function App() {
  const arr = [
    <li>1</li>,
    <li>2</li>,
    <li>3</li>,
    <li>4</li>,
    <li>5</li>,
  ];
  return (
    <>
        <ul>
          {arr}
        </ul>
    </>
  );
}

export default App;
